import React from 'react';

import "./Footer.scss";

const Footer = () => {
	return (
		<div className="Footer container">
			<h2 className="Footer-title">Are You Looking To Travel ?</h2>
			<h4 className="">Make A Reservation By Clicking The Button</h4>

			<button className="btn-default">Book Yours Now</button>
		</div>
	);
}

export default Footer;
